    private void checkMemorySubtract (String xString, String yString, String resultString) {
        BigDecimal x = new BigDecimal(xString);
        BigDecimal y = new BigDecimal(yString);
        BigDecimal resultExpected = new BigDecimal(resultString);

        memory.memorySubtract(x);
        memory.memorySubtract(y);

        BigDecimal resultActual = memory.memoryRecall();
        assertEquals(resultExpected, resultActual);
        memory.memoryClear();
    }


    private void checkMemoryAdd (String xString, String yString, String resultString) {
        BigDecimal x = new BigDecimal(xString);
        BigDecimal y = new BigDecimal(yString);
        BigDecimal resultExpected = new BigDecimal(resultString);

        memory.memoryAdd(x);
        memory.memoryAdd(y);

        BigDecimal resultActual = memory.memoryRecall();
        assertEquals(resultExpected, resultActual);
        memory.memoryClear();
    }


